import React from "react";

function FormContraseña ({showContraseñaForm, Form, handleSubmitContraseña, formData, handleInputChange, contraseñaError, editMode, onClose}) {
    return (
        showContraseñaForm &&
            <Form onSubmit={handleSubmitContraseña}>
              <div className="form-group">
              {editMode && (
                  <div className="d-flex justify-content-end mb-3">
                    <button className="btn-close" onClick={onClose}></button>
                </div>
                )}
              {editMode&&(
                <></>
              )}
              <label htmlFor="password" className="h5">Crear contraseña</label>
                <input 
                type="password" 
                className="form-control" 
                id="contraseña" 
                placeholder="Contraseña" 
                value={formData.contraseña} 
                onChange={(e) => handleInputChange('contraseña', e.target.value )} 
                />
              </div>
              <div className="form-check">
                <label className="form-check-label" htmlFor="invalidCheck">
                Mínimo 8 caracteres con letras y números.                
                </label>
              </div>
              <div className="form-group">
                <label htmlFor="confirmPassword" className="h5">Confirmar contraseña</label>
                <input 
                type="password" 
                className="form-control" 
                id="confirmPassword" 
                placeholder="Confirmar Contraseña"
                value={formData.confirmPassword} 
                onChange={(e) => handleInputChange('confirmPassword', e.target.value )} 
                />
                <br />
                {contraseñaError && <div className="text-danger">{contraseñaError}</div> }
                <br />
              </div>
              <button type="submit" className="btn btn-warning botonn">Crear cuenta</button>
            </Form>
    )
}

export default  FormContraseña;
